import CardPic from '../components/Design/CardPic'
import { Container } from 'react-bootstrap'
import Curveball from '../assets/images/Personal/Curveball.JPG'
import CodePic from '../assets/images/Backgrounds/PankajPatelVSC.jpeg'
import '../assets/css/home.css'
import projects from '../assets/portfolioData.json'

const Portfolio = () => {

    return(
    <div className="wallpaper" style={{backgroundImage: `url(${CodePic})` }}>
        <Container>

            <h1>Portfolio Page</h1>
            <CardPic 
                // key={id}
                style={styles.projectCard}
                image={Curveball}
                title="TESTING"
                description="testing description body"
            />

        </Container>  
    </div>
    )
}

const styles= {
    projectCard : {
        width: '20em', 
        height: '10em', 

    }
}

export default Portfolio;
